@virginmedia 1/2
moved on 01/07, told Virgin Media I would be moving on 18/06. Arranged installation for 09/07. Broadband connected, not TV as ‘not told would need new box’ Showed engineer email which said this.  
New appointment made for 30/07.

@MrN_Primary I use both! Never could use a paper one until this year when I bought a Moleskine one. https://t.co/vuo3tDfjQH expensive but worth EVERY penny. 
Like having it open and easy to use in meetings. 
Back up dates onto Fantatical calendar app which has home &amp; work calendars.

@DeputyGrocott I’ve tried so many and this is the only one that I use religiously. 
Diary on the left hand side lined pages on the right. I buy the XL 19x25cm size. 
https://t.co/vuo3tDfjQH

